import React from 'react';
import Forma from '../components/form/Forma';
import fakeData from '../fakeData/operators.json';
import { BrowserRouter as Router, useParams } from 'react-router-dom';

interface Values {
  id?: number;
  title?: string;
}

const Payment: React.FC<Values> = ({ id, title }) => {
  let params = useParams();
  return (
    <div>
      In React Router v5, You can use hooks to get parameters.
      <br />
      Current id parameter is <strong>{params.id}</strong>
      <br />
      Current hash parameter is <strong>{params.title}</strong>
    </div>
  );
};

export default Payment;
